    constructor(props){
    super(props)
        this.state={

              educations:[{title:'name',schoolName:'name'},{title:'name',schoolName:'name'}]
        }
    }

    education_list(){
        return this.state.educations.map(current =>{
            return <Education_box education={current}  />;
        })
    }
    render(){
        return(
            <div className="container-fluid education_bg">
                <hr />
                <h1> This is education</h1>
                {this.education_list() }
            </div>
        );
    }
}

export default Education;
